import collections
class Solution:
    def hasGroupsSizeX(self, deck) -> bool:
        temp = collections.Counter(deck)
        res = list(temp.values())
        f1 = res[0]
        for i in range(1, len(res)):
            f1 = self.gcd(res[i],f1)
        return f1 >= 2

    def gcd(self,a, b):
        while a % b != 0:
            a = a % b
            a, b = b, a
        return b

